function getData(o){return new Promise((e,t)=>{switch(o){case"students":$.ajax({url:"data/latvian_students.json",dataType:"json",success:function(a){a={labels:a.fields.slice(12,17).map(a=>a.id),data:a.records[29].slice(12,17)};console.log(o," data:",a),e(a)},error:function(a,e,o){console.error("Error loading student data:",o),t(o)}});break;case"NPM":console.log("Fetching NPM data..."),$.ajax({url:"data/NPM_Novadi.json",dataType:"json",success:function(a){a={labels:a.records.map(a=>a[1]),data:a.records.map(a=>a[4])};console.log(o," data:",a),e(a)},error:function(a,e,o){console.error("Error loading NPM data:",o),t(o)}});break;default:console.log("Invalid request"),t("Invalid data type")}})}export{getData};